import React from "react";
import './phones.css'

const Mobiles = ({ mobile }) =>{
    return (
        <div>
          <center><h1>List of mobiles</h1></center>
          {mobile.map((mobile) => (
            <div class="mobile">
                <h1>{mobile.name}</h1>
                <h1>price:{mobile.price}</h1>
              </div>
          ))}
        </div>
    )
}

export default Mobiles;
